    false,nt"url": null,nt"notes": "NCEI Accession 0144530 includes Surface
    underway data collected from HEALY in the Arctic Ocean, Beaufort Sea, Bering Sea,
    Coastal Waters of SE Alaska, Gulf of Alaska and North Pacific Ocean from 2015-07-14
    to 2015-10-28. These data include BAROMETRIC PRESSURE, Partial pressure (or fugacity)
    of carbon dioxide - water, SALINITY and SEA SURFACE TEMPERATURE. The instruments
    used to collect these data include Carbon dioxide (CO2) gas analyzer and Shower
    head chamber equilibrator for autonomous carbon dioxide (CO2) measurement.nnThese
    data were collected by Taro Takahashi and Stew Sutherland of Columbia University;
    Lamont-Doherty Earth Observatory and Colm Sweeney of University of Colorado at Boulder;
    Cooperative Institute for Research In Environmental Sciences as part of the VOS_Healy_Lines_2015
    data set. CDIAC associated the following cruise ID(s) with this data set: 32HQ20150714nnThe
    Global Volunteer Observing Ship (VOS) Program is coordinated by the UNESCO International
    Ocean Carbon Coordination Project (IOCCP). International groups from 14 countries
    have been outfitting research ships and commercial vessels with automated CO2 sampling
    equipment to analyze the carbon exchange between the ocean and atmosphere.",nt"owner_org":
